import "./main.css";
import Movies from "../components/Movies";
const MainMovies = () => {
  return (
    <>
      <h1 className={mtitle}>Movies</h1>
      <Movies j={1} k={30} />
      <Movies j={31} k={60} />
      <Movies j={550} k={590} />
      <Movies j={710} k={750} />
      <Movies j={150} k={200} />
      <Movies j={121} k={149} />
      <Movies j={70} k={109} />
    </>
  );
};

export default MainMovies;
